import React, {useEffect} from 'react';

const NODE_ENV = process.env.NODE_ENV;
interface PageProps {
    children: any,
    title: string,
}

const Page: React.FunctionComponent<PageProps> = (props: PageProps) => {
    const {title, children} = props;
    useEffect(() => {
        if (NODE_ENV !== 'production') {
            return;
        }
    }, [title]);

    return (
        <div>
            <title>{title}</title>
            {children}
        </div>
    );
};

export default Page;
